import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { motion } from 'framer-motion';
import { FaCar, FaSprayCan, FaBroom, FaShieldAlt, FaBars } from 'react-icons/fa';

const AboutPage = () => {
  const [activeFeature, setActiveFeature] = useState(0);
  const navigate = useNavigate();

  const features = [
    { title: "Full Detailing", icon: <FaCar />, description: "Comprehensive interior and exterior detailing for a showroom-fresh look." },
    { title: "Exterior Washing", icon: <FaSprayCan />, description: "Gentle yet thorough exterior cleaning to protect your vehicle's paint." },
    { title: "Interior Cleaning", icon: <FaBroom />, description: "Deep cleaning of all interior surfaces, leaving your car fresh and pristine." },
    { title: "Paint Protection", icon: <FaShieldAlt />, description: "Advanced ceramic coating to shield your car's paint from environmental damage." },
  ];

  return (
    <div className="bg-black text-white h-screen flex flex-col">
      <nav className="p-4 flex justify-between items-center">
        <Link to="/" className="text-2xl font-light">JR Auto Detailing</Link>
        <div className="flex items-center space-x-6">
          <Link to="/models" className="text-sm uppercase tracking-wide hover:text-gray-300">Models</Link>
          <Link to="/customize" className="text-sm uppercase tracking-wide hover:text-gray-300">Customize</Link>
          <Link to="/services" className="text-sm uppercase tracking-wide hover:text-gray-300">Services</Link>
          <button className="text-sm uppercase tracking-wide"><FaBars /></button>
        </div>
      </nav>

      <main className="flex-grow flex">
        <div className="w-1/2 p-8 flex flex-col justify-between">
          <div>
            <h2 className="text-5xl font-light mb-2">Premium Detailing</h2>
            <p className="text-xl mb-4">Elevate your driving experience</p>
            <motion.button
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
              className="bg-white text-black px-8 py-3 rounded-full text-sm font-semibold uppercase tracking-wide"
              onClick={() => navigate('/services')}
            >
              View Services
            </motion.button>
          </div>

          <div className="mt-8">
            <div className="flex justify-between mb-4">
              {features.map((feature, index) => (
                <motion.div
                  key={index}
                  className={`text-center cursor-pointer ${index === activeFeature ? 'text-white' : 'text-gray-500'}`}
                  whileHover={{ scale: 1.1 }}
                  onClick={() => setActiveFeature(index)}
                >
                  <div className="text-3xl mb-2">{feature.icon}</div>
                  <p className="text-xs uppercase">{feature.title}</p>
                </motion.div>
              ))}
            </div>
            <motion.p
              key={activeFeature}
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.3 }}
              className="text-sm"
            >
              {features[activeFeature].description}
            </motion.p>
          </div>

          <div className="mt-8">
            <Link to="/customize" className="text-sm uppercase tracking-wide hover:text-gray-300">
              Customize Your Package â†’
            </Link>
          </div>
        </div>

        <div className="w-1/2 relative">
          <img
            src="https://th.bing.com/th/id/R.14fdb072fac8b59cee64aec6942b51a9?rik=qpxHXfkxDGJy7A&pid=ImgRaw&r=0"
            alt="Luxury car"
            className="absolute inset-0 w-full h-full object-cover"
          />
          <div className="absolute inset-0 bg-gradient-to-t from-black to-transparent" />
          <div className="absolute top-8 right-8 text-right">
            <Stat label="Time Saved" value="3 hrs" />
            <Stat label="Satisfaction" value="99%" />
            <Stat label="Experience" value="10 yrs" />
            <Stat label="Cars Detailed" value="10,000+" />
          </div>
          <div className="absolute bottom-8 left-8 right-8">
            <div className="grid grid-cols-3 gap-4">
              <img src="https://example.com/interior.jpg" alt="Interior" className="w-full h-24 object-cover" />
              <img src="https://example.com/exterior.jpg" alt="Exterior" className="w-full h-24 object-cover" />
              <img src="https://example.com/detail.jpg" alt="Detail" className="w-full h-24 object-cover" />
            </div>
          </div>
        </div>
      </main>
    </div>
  );
};

const Stat = ({ label, value }) => (
  <div className="mb-4">
    <p className="text-2xl font-bold">{value}</p>
    <p className="text-xs uppercase">{label}</p>
  </div>
);

export default AboutPage;
